import React from "react";
import { ListGroup, ListGroupItem } from "reactstrap";

function MenuBar() {
    return (
        <div>
            <ListGroup>
                <ListGroupItem tag="a" href="/" action>Home</ListGroupItem>
                <ListGroupItem tag="a" href="/addcustomer" action>AddCustomer</ListGroupItem>
                <ListGroupItem tag="a" href="/viewcustomers" action>View Customers</ListGroupItem>
                
            </ListGroup>
        </div>
    )
}

export default MenuBar;
